import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import FrontPage from "./Components/Pages/FrontPage";
import Lookbook from "./Components/Pages/Lookbook";
import Contact from "./Components/Pages/Contact";
import MailingList from "./Components/Pages/MailingList";
import Shop from "./Components/Pages/Shop";
import AdminView from "./Components/Pages/AdminView";
import ProtectedRoutes from "./Components/Pages/ProtectedRoutes";
import items from "./Data/images.json";
import inventory from "./Data/inventory.json";

export default function App() {
  const { stock } = inventory;
  const { products } = items;
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" exact element={<FrontPage />} />
          <Route
            path="/shop"
            exact
            element={<Shop stock={stock} products={products} />}
          >
            <Route path="shop/jackets"></Route>
            <Route path="shop/hats\accessories"></Route>
            <Route path="shop/tops\sweaters"></Route>
            <Route path="shop/shirts"></Route>
            <Route path="shop/pants"></Route>
          </Route>
          <Route
            path="/Lookbook"
            exact
            element={<Lookbook stock={stock} products={products} />}
          />
          <Route path="/contact" exact element={<Contact />} />
          <Route path="/mailing-list" exact element={<MailingList />} />
          <Route element={ProtectedRoutes}>
            <Route path="/admin" exact element={<AdminView />}></Route>
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}
